import Post from './components/Post';
import './App.css';
import Header from './components/Header';
import {Route,Routes} from 'react-router-dom'
function App() {
  return (
  <Routes>
    <Route index element={

    <main>
      <Header/>
      <Post/>
      <Post/>
      <Post/>
    </main>
    } />
    <Route path={'/login'} element={
      <main>
        <div>login page</div>
      </main>
    }/>
  </Routes>
  );
}

export default App;
